import faceMalin from "./faceMalin.JPG";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img
          src={faceMalin}
          className="App-logo"
          alt="logo"
          className="img-fluid"
        />
      </header>
    </div>
  );
}

export default App;
